import React, { useCallback, useContext } from 'react'
import Grid from '@mui/material/Grid'
import Box from '@mui/material/Box'
import TextField from '@mui/material/TextField'
import Button from '@mui/material/Button'
import FormControlLabel from '@mui/material/FormControlLabel'
import FormHelperText from '@mui/material/FormHelperText'
import Checkbox from '@mui/material/Checkbox'
import { AppContext } from '../Context'

export default function SecondStep() {
  const {
    formValues,
    handleChange,
    handleBack,
    handleNext,
    variant,
    margin
  } = useContext(AppContext)
  const { tfn, agreenemt, bsb, account } = formValues

  const isError = useCallback(
    () =>
      Object.keys({ tfn, bsb, account, agreenemt }).some(
        (name) =>
          (formValues[name].required && !formValues[name].value) ||
          formValues[name].error
      ),
    [formValues, tfn, bsb, account, agreenemt]
  )

  return (
    <>
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <TextField
            variant={variant}
            margin={margin}
            fullWidth
            label="TFN"
            name="tfn"
            placeholder="TFN"
            value={tfn.value}
            onChange={handleChange}
            error={!!tfn.error}
            helperText={tfn.error}
            required={tfn.required}
          />
        </Grid>

        <Grid item xs={4}>
          <TextField
            variant={variant}
            margin={margin}
            fullWidth
            label="BSB"
            name="bsb"
            placeholder="BSB"
            value={bsb.value}
            onChange={handleChange}
            error={!!bsb.error}
            helperText={bsb.error}
            required={bsb.required}
          />
        </Grid>


        <Grid item xs={8}>
          <TextField
            variant={variant}
            margin={margin}
            fullWidth
            label="Account No."
            name="account"
            placeholder="Account"
            value={account.value}
            onChange={handleChange}
            error={!!account.error}
            helperText={account.error}
            required={account.required}
          />
        </Grid>

        <Grid item xs={12}>
          <FormControlLabel
            control={
              <Checkbox
                checked={agreenemt.value}
                onChange={handleChange}
                name="agreenemt"
                color="primary"
                required={agreenemt.required}
              />
            }
            label="Agree to terms and conditions"
          />
          <FormHelperText error={!!agreenemt.error}>
            {agreenemt.error}
          </FormHelperText>
        </Grid>
      </Grid>

      <Box sx={{ display: 'flex', justifyContent: 'flex-end', mt: 3 }}>
        <Button onClick={handleBack} sx={{ mr: 1 }}>
          Back
        </Button>
        <Button
          variant="contained"
          disabled={isError()}
          color="primary"
          onClick={!isError() ? handleNext : () => null}
        >
          Next
        </Button>
      </Box>
    </>
  )
}
